  false,\n\t\"url\": null,\n\t\"notes\": \"In 2013 a setback levee was constructed
  on the JBH Mainland.  In 2014 the main levee was breached, and water flowed into
  a 70-acre section of land that had been protected from tidal flow for about 70 years.
  \ This section had been tidally inundated before construction of the original levee
  in the early 1900s.  The area grew up into wet upland habitat mainly covered with
  grasses and forbs.  Reintroduction of water into the area represents a return to
  its original regime, but also represents a major on-going disturbance.  The Refuge
  wishes to document the change in vegetation and landscape over time by taking low-tide
  photos on a consistent basis.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
